// Build a sorted map so keys are alphabetical
const Icons = Object.keys(IconsUnsorted)
  .sort((a, b) => a.localeCompare(b))
  .reduce((acc, key) => {
    acc[key] = IconsUnsorted[key];
    return acc;
  }, {});

export default Icons;
